import React from 'react'
import { burger } from '../assets'

const Menu = () => {
  return (
    <div className='p-10'>
    <div className='card--shadow'>
      <img src = {burger} alt="burger" className='h-[100px] w-[100px]'></img>
      <p className='text-white'>Hamburger</p>
    </div>
    </div>
  )
}

export default Menu
